import React, { useState } from "react";
import axios from "axios";

const AddPolicy = ({ changeView }) => {
    const [policy, setPolicy] = useState({
        policyName: "",
        policyNumber: "",
        policyType: "",
        policyTerm: "",
        startDate: "",
        endDate: "",
        premiumAmount: "",
        paymentFrequency: "",
        coverage: "",
        sumAssured: "",
        nomineeName: "",
        inclusions: "",
        exclusions: "",
        additionalDetails: "",
        claimStatus: "",
        lastPaymentDate: "",
        nextPaymentDueDate: "",
        fullName: "",
        dateOfBirth: "",
        contactNumber: "",
        emailAddress: "",
    });

    const handleChange = (e) => {
        setPolicy({ ...policy, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        axios
            .post("http://localhost:8080/api/policies", policy)
            .then(() => alert("Policy added successfully!"))
            .catch((error) => console.error("Error adding policy:", error));
    };

    return (
        <div style={styles.formContainer}>
            <h2>Add Policy</h2>
            <form onSubmit={handleSubmit}>
                {/* Personal Details Section (Left Column) */}
                <div style={styles.column}>
                    <div style={styles.section}>
                        <h3>Personal Details</h3>
                        <div style={styles.inputGroup}>
                            <label>Full Name:</label>
                            <input name="fullName" placeholder="Full Name" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Date of Birth:</label>
                            <input name="dateOfBirth" type="date" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Contact Number:</label>
                            <input name="contactNumber" placeholder="Contact Number" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Email Address:</label>
                            <input name="emailAddress" type="email" placeholder="Email Address" onChange={handleChange} required />
                        </div>
                    </div>
                </div>

                {/* Policy Details Section (Middle Column) */}
                <div style={styles.column}>
                    <div style={styles.section}>
                        <h3>Policy Details</h3>
                        <div style={styles.inputGroup}>
                            <label>Policy Name:</label>
                            <input name="policyName" placeholder="Policy Name" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Policy Number:</label>
                            <input name="policyNumber" placeholder="Policy Number" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Policy Type:</label>
                            <input name="policyType" placeholder="Policy Type" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Policy Term (in years):</label>
                            <input name="policyTerm" type="number" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Start Date:</label>
                            <input name="startDate" type="date" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>End Date:</label>
                            <input name="endDate" type="date" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Premium Amount:</label>
                            <input name="premiumAmount" placeholder="Premium Amount" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Payment Frequency:</label>
                            <select name="paymentFrequency" onChange={handleChange} required>
                                <option value="">Select Frequency</option>
                                <option value="monthly">Monthly</option>
                                <option value="yearly">Yearly</option>
                            </select>
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Coverage:</label>
                            <input name="coverage" placeholder="Coverage" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Sum Assured:</label>
                            <input name="sumAssured" placeholder="Sum Assured" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Nominee Name:</label>
                            <input name="nomineeName" placeholder="Nominee Name" onChange={handleChange} required />
                        </div>
                    </div>
                </div>

                {/* Additional Details Section (Right Column) */}
                <div style={styles.column}>
                    <div style={styles.section}>
                        <h3>Additional Details</h3>
                        <div style={styles.inputGroup}>
                            <label>Inclusions:</label>
                            <input name="inclusions" placeholder="Inclusions" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Exclusions:</label>
                            <input name="exclusions" placeholder="Exclusions" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Additional Details:</label>
                            <textarea name="additionalDetails" placeholder="Additional Details" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Claim Status:</label>
                            <input name="claimStatus" placeholder="Claim Status" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Last Payment Date:</label>
                            <input name="lastPaymentDate" type="date" onChange={handleChange} required />
                        </div>
                        <div style={styles.inputGroup}>
                            <label>Next Payment Due Date:</label>
                            <input name="nextPaymentDueDate" type="date" onChange={handleChange} required />
                        </div>
                    </div>
                </div>

                <div style={styles.buttonContainer}>
                    <button type="submit" style={styles.button}>Submit</button>
                    <button type="button" style={styles.button} onClick={() => changeView("main")}>Back to Main</button>
                </div>
            </form>
        </div>
    );
};

const styles = {
    formContainer: {
        textAlign: "center",
        padding: "20px",
        border: "1px solid #ccc",
        borderRadius: "10px",
        width: "80%",
        margin: "auto",
        color: "black",
        backgroundColor: "#f9f9f9",
    },
    column: {
        display: "inline-block",
        width: "32%",
        verticalAlign: "top",
        margin: "0 10px",
        boxSizing: "border-box",
    },
    section: {
        marginBottom: "30px",
        textAlign: "left",
        paddingLeft: "20px",
        paddingRight: "20px",
    },
    inputGroup: {
        width: "100%",
        marginBottom: "15px",
    },
    buttonContainer: {
        display: "flex",
        justifyContent: "center",
    },
    button: {
        margin: "10px",
        padding: "10px 20px",
        fontSize: "16px",
        border: "none",
        borderRadius: "5px",
        cursor: "pointer",
        backgroundColor: "#4CAF50",
        color: "black",
    },
};

export default AddPolicy;
